

-- drop the old mis-spelt name
DROP TABLE documents.nata_laboritories;

-- create new table and insert data
CREATE TABLE documents.lu_nata_laboratories
(
  pk serial primary key,
  accreditation_no text NOT NULL,
  labname text NOT NULL,
  labname2 text,
  address text,
  address2 text,
  address3 text,
  suburb text,
  state text,
  postcode text,
  contact text,
  phone text,
  fax text,
  mobile text,
  email text,
  website text,
  facility_type text,
  last_updated date NOT NULL
  );
  
ALTER TABLE documents.lu_nata_laboratories  OWNER TO easygp;
GRANT ALL ON TABLE documents.lu_nata_laboratories TO staff;
GRANT SELECT ON TABLE documents.lu_nata_laboratories_pk_seq TO staff;

comment on table documents.lu_nata_laboratories is
